import { CardDeck } from "react-bootstrap";
import Card from "./Card";

export default function CardDesk(cardInfo) {
  return (
    <CardDeck>
      {cardInfo.map((s) => (
        <Card
          text={s.text}
          title={s.title}
          backgroundColor={s.backgroundColor}
          color={s.color}
        />
      ))}
    </CardDeck>
  );
}
